        <style media="screen">
        #tbs-header {
            height: 84px;
            margin-bottom: 12px;
        }

        #logo{
          margin-top: 20px;
        }

        #tbs-header-content {
            background-color: #00a9e0;
            color: #fff;
            height: inherit;
            left:0;
            line-height: 84px;
            overflow: hidden;
            padding: 0 24px;
            position:fixed;
            top:0;
            transition: height linear 0.25s;
            -webkit-transition: height linear 0.25s;
            -moz-transition: height linear 0.25s;
            width: 100%;
            z-index: 1;
        }

        body.scrolled #tbs-header-content {
            height: 4px;
        }

        #tbs-nav {
            height: 36px;
            padding: 0 24px;
        }

        #tbs-nav-content {
            margin-left: -8px;
        }

        /* ------------------------------------------------------------------------ */
        /* Login-Box																*/
        /* ------------------------------------------------------------------------ */

        #tbs-container {
            margin: 0 auto;
            max-width: 500px;
            padding: 48px 12px 0;
        }

        #tbs-headline {
            margin-bottom: 48px;
        }

        #tbs-headline h1 {
            margin: 0;
            padding: 0;
        }

        #tbs-headline h5 {
            margin: 0;
            padding: 0;
            top: 6px;
        }

        #tbs-infobox {
            background-color: #f2f2f2;
            padding: 12px 12px;
            line-height: 1em;
        }

        #pw_submit {
            position: relative;
        }

        #pw_submit[disabled]:after {
            background: url('../images/load.gif') no-repeat;
            background-size: cover;
            bottom: 0;
            content: '';
            height: 24px;
            margin: auto 0;
            /*opacity: 0.15;*/
            position: absolute;
            right: -36px;
            top: 0;
            width: 24px;
        }

        #tbs-recovery-link {
            text-align: right;
            margin-bottom: 2px;
        }

        .tbs-reauth-label {
            font-size: 15px;
            line-height: 36px;
        }

        .error-box {
            background-color: #fdf2f2;
            border: 1px solid #b20000;
            border-radius: 4px;
            color: #b20000;
            font-size: 16px;
            margin-bottom: 36px;
            padding: 12px;
        }

        #happy2{
          height: 90px;
          margin-bottom: -40px;
        }


        /* ------------------------------------------------------------------------ */
        /* Footer																	*/
        /* ------------------------------------------------------------------------ */

        #tbs-footer {
            border-top: 1px solid #dcdcdc;
            margin-top: 72px;
            padding: 12px 24px 36px;
        }

        #tbs-footer.sticky {
            bottom: 0;
            position: fixed;
            width: 100%;
        }


        #tbs-footer .tbs-text-11 {
            color: #8c8c8c;
        }

        #key1{
          height:50px;
          font-style: 20px;
          padding: 10px;
        }

        /* ------------------------------------------------------------------------ */
        /* PDE Toolbox  															*/
        /* ------------------------------------------------------------------------ */

        ol {
            margin: 0;
            padding: 0 0 0 24px;
        }

        p, p[class] {
            padding: 0;
        }

        .icon-information {
            cursor: pointer;
        }

        .form-input-set {
            position: relative;
        }

        .form-input-set .icon-information {
            position: absolute;
            right: 12px;
            bottom: 9px;
        }

        .form-input-set label {
            bottom: 1px;
            cursor: text;
            left: 12px;
            line-height: 35px;
            position: absolute;
        }

        .form-input {
            padding-left: 35%;
            padding-right: 36px;
        }

        .modal.fade.in {
            z-index: 2;
        }

        .btn-large {
            padding-left: 48px;
            padding-right: 48px;
        }

        /* Button link from bootstrap  */
        .btn-link {
            border-radius: 0;
            color: #0090c4;
            font-weight: normal;
            padding: 0;
        }
        .btn-link,
        .btn-link:active,
